import { Chart, Tooltip, Axis, Legend, Pie, Coord, Line, Bar, Point} from 'viser-react';
import * as React from 'react';
import Progress from "react-progress-2";

import { Row, Col, Card, Button, Icon} from "antd";
import axios from "axios";
import ReactApexChart from 'react-apexcharts'

class AnalyticalTest extends React.Component {

      constructor(props) {
        super(props);

        this.state = {
          options: {
            responsive: [{
              breakpoint: 480,
              options: {
                chart: {
                  width: 200
                },
                legend: {
                  position: 'bottom'
                }
              }
            }]
          },
          series: [44, 55, 41, 17, 15]
        }
      }

async loadFeed() {
    Progress.show();

}



      render() {
        return (


   <div id="root">
    <div id="divLoader">

      <svg class="svgLoader" viewBox="0 0 100 100" width="10em" height="10em">
        <path ng-attr-d="{{config.pathCmd}}" ng-attr-fill="{{config.color}}"
              stroke="none" d="M10 50A40 40 0 0 0 90 50A40 42 0 0 1 10 50"
              fill="#51CACC" transform="rotate(179.719 50 51)">
          <animateTransform attributeName="transform" type="rotate" calcMode="linear"
                            values="0 50 51;360 50 51" keyTimes="0;1" dur="1s" begin="0s"
                            repeatCount="indefinite"></animateTransform></path>
      </svg>
    </div>
  </div>

        );
      }
    }


export default AnalyticalTest;
